import './App.css';

function App() {
		const Random_Emojies = () => {
			const btn = document.getElementById("emoji");
			const emojis = [
				"沽",
				"沽",
				"洟｣",
				"沽",
				"沽",
				"洟曾

沽ｬ",
			];

			btn.addEventListener("mouseover", () => {
				btn.innerHTML = emojis[Math.floor(Math.random() * emojis.length)];
			});
		};
	return (
		<div className="App">
					<div id="emoji" onMouseOver={Random_Emojies}>洟｣</div>
		</div>
	);
}

export default App;
